import React from "react";
import { NavLink } from "react-router-dom";

const ArchiveJournalEntry = (props) => {
    return (
        <div>
            <NavLink to='/journal'>Back</NavLink>
            <p>{props.title}</p>
            <p>{props.body}</p>
            <p>{props.conclusion}</p>
        </div>

    )
}

export default ArchiveJournalEntry
